#pragma mark - tint color
-(UIColor *) masterTintColor {
    return masterTintColor;
}
-(void)setMasterTintColor:(UIColor *)tintColor {
    return;
    
    masterTintColor = tintColor;
    
    CGColorSpaceRef colorSpace = CGColorGetColorSpace([masterTintColor CGColor]);
    if (CGColorSpaceGetModel(colorSpace) != kCGColorSpaceModelMonochrome) {
        CGFloat hue, sat, bri;
        [masterTintColor getHue:&hue saturation:&sat brightness:&bri alpha:nil];
        
        self.background_color = [UIColor colorWithHue:hue saturation:0.8*sat brightness:0.2*bri alpha:0.7];
        self.color       = [UIColor colorWithHue:hue saturation:0.8*sat brightness:0.8*bri alpha:1.0];
        self.light_color = [UIColor colorWithHue:hue saturation:0.8*sat brightness:0.6*bri alpha:1.0];
        self.dark_color  = [UIColor colorWithHue:hue saturation:0.8*sat brightness:0.4*bri alpha:1.0];
        self.lines_color = [UIColor colorWithHue:hue saturation:1.0*sat brightness:1.0*bri alpha:1.0];
    }
    else {
        CGFloat white;
        [masterTintColor getWhite:&white alpha:nil];
        
        self.background_color = [UIColor colorWithWhite:white*0.2 alpha:0.7];
        self.color       = [UIColor colorWithWhite:white*0.8 alpha:1.0];
        self.light_color = [UIColor colorWithWhite:white*0.6 alpha:1.0];
        self.dark_color  = [UIColor colorWithWhite:white*0.4 alpha:1.0];
        self.lines_color = [UIColor colorWithWhite:white*1.0 alpha:1.0];
    }
    [self setRoundCorners];
    canvasForDrawing.lineColor = self.lines_color;
    canvasForDrawing.backgroundColor = self.background_color;
}

- (void) setGestureColor:(UIColor*) color {
    self.lines_color = color;
    canvasForDrawing.lineColor = self.lines_color;
}

- (void) setHelpBackgroundColor:(UIColor*) color {
    UIColor* bgColor = nil;
    CGColorSpaceRef colorSpace = CGColorGetColorSpace([color CGColor]);
    if (CGColorSpaceGetModel(colorSpace) != kCGColorSpaceModelMonochrome) {
        CGFloat hue, sat, bri;
        [color getHue:&hue saturation:&sat brightness:&bri alpha:nil];
        bgColor = [UIColor colorWithHue:hue saturation:sat brightness:bri alpha:0.5];
    }
    else {
        CGFloat white;
        [color getWhite:&white alpha:nil];
        bgColor = [UIColor colorWithWhite:white alpha:0.5];
    }
    helpView.backgroundColor = bgColor;
    self.backgroundColor = [UIColor clearColor];
    canvasForDrawing.backgroundColor = bgColor;
}

- (void) setRoundCorners {
    [self setCornerRadiousToView:self];
    [self setCornerRadiousToView:self.gkLogoImageView];
}

- (void) setCornerRadiousToView:(UIView*) aView {
    aView.layer.cornerRadius = 13.5;
    aView.clipsToBounds = YES;
}

#pragma mark - Static management
+ (GK_FloatingWindow*) showFloatingView {
    if (staticInstance == nil) {
        staticInstance = [GK_FloatingWindow loadViewFromCode];
        [staticInstance initialize];
        staticInstance.rootViewController = [UIViewController new];
        staticInstance.rootViewController.view.alpha = 0.0;
    }
    [staticInstance showFloatingView];
    return staticInstance;
}

