- (CGRect) referenceCGRect {
    return [self referenceCGRectForOrientation:[UIApplication sharedApplication].statusBarOrientation];
}

- (CGRect) referenceCGRectForOrientation:(UIInterfaceOrientation) orientation {
    CGRect referenceFrame = [UIScreen mainScreen].bounds;
    CGRect offsetGivenStatusBar = [self offsetGivenOrientation:orientation];
    referenceFrame.origin.x += offsetGivenStatusBar.origin.x;
    referenceFrame.origin.y += offsetGivenStatusBar.origin.y;
    referenceFrame.size.height += offsetGivenStatusBar.size.height;
    referenceFrame.size.width += offsetGivenStatusBar.size.width;
    
    return referenceFrame;
}

- (CGRect) offsetGivenStatusBarOrientation{
    return [self offsetGivenOrientation:[UIApplication sharedApplication].statusBarOrientation];
}

- (CGRect) offsetGivenOrientation:(UIInterfaceOrientation) orientation {
    CGRect statusBarFrame = [[UIApplication sharedApplication] statusBarFrame];
    CGRect offsetGivenStatusBar = CGRectZero;
    if (orientation == UIInterfaceOrientationPortrait) {
        offsetGivenStatusBar.origin.y = statusBarFrame.size.height;
        offsetGivenStatusBar.size.height = -statusBarFrame.size.height;
    }
    else if (orientation == UIInterfaceOrientationPortraitUpsideDown) {
        offsetGivenStatusBar.size.height = -statusBarFrame.size.height;
    }
    else if (orientation == UIInterfaceOrientationLandscapeLeft) {
        offsetGivenStatusBar.origin.x = statusBarFrame.size.width;
        offsetGivenStatusBar.size.width = -statusBarFrame.size.width;
    }
    else if (orientation == UIInterfaceOrientationLandscapeRight) {
        offsetGivenStatusBar.size.width = -statusBarFrame.size.width;
    }
    return offsetGivenStatusBar;
}

- (CGAffineTransform) transformGivenStatusBarOrientation {
    return [self transformGivenOrientation:[UIApplication sharedApplication].statusBarOrientation];
}

- (CGAffineTransform) transformGivenOrientation:(UIInterfaceOrientation) orientation {
    return CGAffineTransformMakeRotation([self angleForOrientation:orientation]);
}

- (CGFloat) angleForOrientation:(UIInterfaceOrientation) orientation {
    if (orientation == UIInterfaceOrientationPortrait) {
        return 0.0;
    }
    else if (orientation == UIInterfaceOrientationPortraitUpsideDown) {
        return M_PI;
    }
    else if (orientation == UIInterfaceOrientationLandscapeLeft) {
        return -M_PI_2;
    }
    else if (orientation == UIInterfaceOrientationLandscapeRight) {
        return M_PI_2;
    }
    return 0.0;
}

- (void) showFloatingView {
    CGRect referenceFrame = [self referenceCGRect];
    self.fullScreenRect = referenceFrame;
    referenceFrame.size.width = referenceFrame.size.width/5;
    referenceFrame.size.height = referenceFrame.size.height/5;
    self.frame = CGRectMake(self.frame.origin.x, self.frame.origin.y, self.contractedSize.width, self.contractedSize.height);
    
    self.windowLevel = UIWindowLevelAlert;
    self.hidden = NO;
    
    CGAffineTransform transform = [self transformGivenStatusBarOrientation];
    //gkLogoImageView.transform = transform;
    helpView.transform = transform;
    
    helpCollectionView.alpha = 0.0;
    helpCollectionView.hidden = YES;
    showingHelp = NO;
    [self resetIdleTimer];
    self.panGesture.enabled = YES;
    self.tapGesture.enabled = YES;
}

- (CGSize) contractedSizeFrom:(CGSize) size {
    float contractedHeight = 40.0;
    CGSize contractedSize = size;
    UIInterfaceOrientation orientation = [UIApplication sharedApplication].statusBarOrientation;
    if (UIInterfaceOrientationIsLandscape(orientation)) {
        contractedSize.width = contractedHeight;
    }
    else {
        contractedSize.height = contractedHeight;
    }
    return contractedSize;
}

