#pragma mark - Initialization
- (void) initialize {
    [[NSNotificationCenter defaultCenter] addObserver:self selector:@selector(applicationDidRotate:) name:UIApplicationDidChangeStatusBarOrientationNotification object:nil];
    self.reajustTimer = [NSTimer scheduledTimerWithTimeInterval:1.3467 target:self selector:@selector(ensureWindowIsOnScreen) userInfo:nil repeats:YES];
    
    self.panGesture = [[UIPanGestureRecognizer alloc] initWithTarget:self action:@selector(onPan:)];
    [self addGestureRecognizer:self.panGesture];
    
    self.tapGesture = [[UITapGestureRecognizer alloc] initWithTarget:self action:@selector(showHelpView)];
    [self addGestureRecognizer:self.tapGesture];
    
    self.hideHelpGesture = [[UITapGestureRecognizer alloc] initWithTarget:self action:@selector(onCloseHelpButtonTUI:)];
    [self addGestureRecognizer:self.hideHelpGesture];
    self.hideHelpGesture.delegate = (id)self;
    self.hideHelpGesture.enabled = NO;
    
    [self setRoundCorners];
    //self.masterTintColor = [UIColor darkGrayColor];//[UIColor colorWithRed:0.5 green:0.5 blue:0.85 alpha:1.0];
    [self setGestureColor:[UIColor whiteColor]];
    
    [self setVisorSize];
    
    [helpCollectionView registerClass:[GK_HelpCell class] forCellWithReuseIdentifier:@"GK_HelpCell"];
    [self resetIdleTimer];
    
    [self showStaticLogo];
}

- (void) setVisorSize {
    self.contractedSize = CGSizeMake(60, 60);
    self.frame = CGRectMake(0, 0, self.contractedSize.width, self.contractedSize.height);
}

- (void)dealloc {
    [[NSNotificationCenter defaultCenter] removeObserver:self];
    self.tapGesture = nil;
    self.panGesture = nil;
    [self.reajustTimer invalidate];
    self.reajustTimer = nil;
    [self.idleTimer invalidate];
    self.idleTimer = nil;
    self.helpGestures = nil;
}

#pragma mark - UIPanGestureRecognizer selector for HOVERING
- (void) onPan:(UIPanGestureRecognizer*) gesture {
    [self cancelIdleTimer];
    [self stopCloseHelpVisorTimer];
    [super setAlpha:1.0];
    
    if (gesture.state == UIGestureRecognizerStateBegan) {
        self.originPoint = self.frame.origin;
    }
    else if (gesture.state == UIGestureRecognizerStateChanged){
        CGPoint point = [gesture translationInView:self];
        point = CGPointApplyAffineTransform(point, self.transform);
        point.x += self.originPoint.x;
        point.y += self.originPoint.y;
        
        CGRect currentFrame = self.frame;
        currentFrame.origin = point;
        self.frame = currentFrame;
    }
    else if(gesture.state == UIGestureRecognizerStateCancelled || gesture.state == UIGestureRecognizerStateFailed || gesture.state == UIGestureRecognizerStateEnded) {
        [self resetIdleTimer];
        [self ensureWindowIsOnScreen];
    }
}
- (void) ensureWindowIsOnScreen {
    [self ensureWindowIsOnScreenAnimated:YES];
}

- (CGFloat) distanceFromPoint:(CGPoint) a toPoint:(CGPoint) b {
    return hypot(a.x - b.x, a.y - b.y);
}

- (void) ensureWindowIsOnScreenAnimated:(BOOL) animated {
    if(self.panGesture.state == UIGestureRecognizerStatePossible ||  self.panGesture.state == UIGestureRecognizerStateCancelled || self.panGesture.state == UIGestureRecognizerStateFailed || self.panGesture.state == UIGestureRecognizerStateEnded) {
        CGRect referenceCGRect = [self referenceCGRect];
        CGPoint point = self.center;
        CGFloat minBoundX = referenceCGRect.origin.x + self.frame.size.width/2;
        CGFloat minBoundY = referenceCGRect.origin.y + self.frame.size.height/2;
        CGFloat maxBoundX = referenceCGRect.origin.x + referenceCGRect.size.width - self.frame.size.width/2;
        CGFloat maxBoundY = referenceCGRect.origin.y + referenceCGRect.size.height - self.frame.size.height/2;
        
        CGPoint pointTop = point;
        CGPoint pointBottom = point;
        CGPoint pointLeft = point;
        CGPoint pointRight = point;
        
        pointTop.y = minBoundY;
        pointTop.x = MAX(minBoundX, MIN(point.x, maxBoundX));
        
        pointBottom.y = maxBoundY;
        pointBottom.x = MAX(minBoundX, MIN(point.x, maxBoundX));
        
        pointLeft.y = MAX(minBoundY, MIN(point.y, maxBoundY));
        pointLeft.x = minBoundX;
        
        pointRight.y = MAX(minBoundY, MIN(point.y, maxBoundY));
        pointRight.x = maxBoundX;
        
        CGFloat distTop = [self distanceFromPoint:point toPoint:pointTop];
        CGFloat distBottom = [self distanceFromPoint:point toPoint:pointBottom];
        CGFloat distLeft = [self distanceFromPoint:point toPoint:pointLeft];
        CGFloat distRight = [self distanceFromPoint:point toPoint:pointRight];
        
        CGFloat distAux = distTop;
        CGPoint pointAux = pointTop;
        
        if (distBottom < distAux) {
            distAux = distBottom;
            pointAux = pointBottom;
        }
        
        if (distLeft < distAux) {
            distAux = distLeft;
            pointAux = pointLeft;
        }
        
        if (distRight < distAux) {
            //No need to set distAux as we are no longer going to use it
            pointAux = pointRight;
        }
                
        if (!CGPointEqualToPoint(pointAux, self.center)) {
            if (animated) {
            [UIView animateWithDuration:0.15
                                  delay:0.0 options:UIViewAnimationOptionCurveEaseOut
                             animations:^{
                                 self.center = pointAux;
                             } completion:nil];
            }
            else {
                self.center = pointAux;
            }
        }
    }
}

#pragma mark - on application rotation
- (void) applicationDidRotate:(NSNotification*) notification {
    CGPoint prevPos = self.center;
    UIInterfaceOrientation prevOrientation = [[notification.userInfo objectForKey:UIApplicationStatusBarOrientationUserInfoKey] integerValue];
    UIInterfaceOrientation newOrientation = [UIApplication sharedApplication].statusBarOrientation;
    [self showFloatingView];
    
    [UIView animateWithDuration:0.15
                     animations:^{
                         [super setAlpha:0.0];
                     }
                     completion:^(BOOL finished) {
                         CGPoint newPoint = [self newPosAfterRotationFromOrientation:prevOrientation toOrientation:newOrientation fromPos:prevPos];
                         self.center = newPoint;
                         [self ensureWindowIsOnScreenAnimated:NO];
                         [UIView animateWithDuration:0.15 animations:^{
                             [super setAlpha:0.5];
                             showingHelp = NO;
                         }];
                     }];
}

- (CGPoint) newPosAfterRotationFromOrientation:(UIInterfaceOrientation) prevOrientation toOrientation:(UIInterfaceOrientation) newOrientation fromPos:(CGPoint) oldPos {
    if (newOrientation == prevOrientation) {
        return oldPos;
    }
    
    CGPoint newPoint = oldPos;
    CGSize screenSize = [UIScreen mainScreen].bounds.size;
    
    CGAffineTransform rotation = CGAffineTransformMakeRotation([self angleForOrientation:newOrientation] - [self angleForOrientation:prevOrientation]);
    
    CGFloat multipler = screenSize.width/screenSize.height;
    newPoint = CGPointMake(newPoint.x, newPoint.y*multipler);
    
    CGPoint centerOfRotation = CGPointMake(screenSize.width/2.0, screenSize.width/2.0);
    newPoint = CGPointMake(newPoint.x - centerOfRotation.x, newPoint.y - centerOfRotation.y);
    
    newPoint = CGPointApplyAffineTransform(newPoint, rotation);
    
    newPoint = CGPointMake(newPoint.x + centerOfRotation.x, newPoint.y + centerOfRotation.y);
    
    newPoint = CGPointMake(newPoint.x, newPoint.y/multipler);
    
    return newPoint;
}

- (void) cancelIdleTimer {
    [self.idleTimer invalidate];
    self.idleTimer = nil;
}

- (void) resetIdleTimer {
    [self cancelIdleTimer];
    
    if (!showingHelp)
        self.idleTimer = [NSTimer scheduledTimerWithTimeInterval:1.0 target:self selector:@selector(idleTimerTimeOut) userInfo:nil repeats:NO];
}

- (void) idleTimerTimeOut {
    [UIView animateWithDuration:0.2 animations:^{
        [self showStaticLogo];
        canvasForDrawing.alpha = 0.0;
        [super setAlpha:0.5];
        gkLogoImageView.alpha = 1.0;
        helpView.alpha = 1.0;
    }];
    [self cancelIdleTimer];
}

- (UIImage*) imageFromBase64:(NSString*) base64Str {
    return [UIImage imageWithData:[NSData dataWithContentsOfURL:[NSURL URLWithString:base64Str]]];
}

- (void) showStaticLogo {
    self.gkLogoImageView.animationImages = nil;
    self.gkLogoImageView.image = [self imageFromBase64:LOGO_STATIC_BASE64];
}

- (void) showErrorLogo {
    self.gkLogoImageView.animationImages = nil;
    self.gkLogoImageView.image = [self imageFromBase64:LOGO_WARNING_BASE64];
}

- (void) showLoadingLogo {
    if (self.gkLogoImageView.animationImages != nil)
        return;
    
    self.gkLogoImageView.image = nil;
    self.gkLogoImageView.animationImages = @[[self imageFromBase64:LOGO_LOAD_01_BASE64],
                                             [self imageFromBase64:LOGO_LOAD_02_BASE64],
                                             [self imageFromBase64:LOGO_LOAD_03_BASE64],
                                             [self imageFromBase64:LOGO_LOAD_04_BASE64],
                                             [self imageFromBase64:LOGO_LOAD_05_BASE64],
                                             [self imageFromBase64:LOGO_LOAD_06_BASE64],
                                             [self imageFromBase64:LOGO_LOAD_07_BASE64],
                                             [self imageFromBase64:LOGO_LOAD_08_BASE64]];
    self.gkLogoImageView.animationDuration = 5.0/self.gkLogoImageView.animationImages.count;
    [self.gkLogoImageView startAnimating];
}

- (CGRect) getFrameForExpandedFrameView {
    CGRect frame = self.frame;
    CGFloat maximunWidth = 540;
    if (UIInterfaceOrientationIsLandscape([UIApplication sharedApplication].statusBarOrientation)) {
        frame.size.height = MIN(self.fullScreenRect.size.height, MIN(maximunWidth, self.helpGestures.count*60)+60.0);
        NSInteger numberOfRows = ceil(self.helpGestures.count / floor(frame.size.height/60.0));
        frame.size.width = MIN(self.fullScreenRect.size.width, numberOfRows*60);
    }
    else {
        frame.size.width = MIN(self.fullScreenRect.size.width, MIN(maximunWidth, self.helpGestures.count*60)+60.0);
        NSInteger numberOfRows = ceil(self.helpGestures.count / floor(frame.size.width/60.0));
        frame.size.height = MIN(self.fullScreenRect.size.height, numberOfRows*60);
    }
    
    if ([UIApplication sharedApplication].statusBarOrientation == UIInterfaceOrientationLandscapeLeft) {
        frame.origin.y -= (frame.size.height - 60.0);
    }
    else if ([UIApplication sharedApplication].statusBarOrientation == UIInterfaceOrientationPortraitUpsideDown) {
        frame.origin.x -= (frame.size.width - 60.0);
    }
    
    frame.origin.x = MAX(0.0, frame.origin.x);
    frame.origin.y = MAX(0.0, frame.origin.y);
    
    frame.origin.x -= MAX(0.0, ((frame.origin.x + frame.size.width) - (self.fullScreenRect.origin.x + self.fullScreenRect.size.width)));
    frame.origin.y -= MAX(0.0, ((frame.origin.y + frame.size.height) - (self.fullScreenRect.origin.y + self.fullScreenRect.size.height)));
    
    return frame;
}

