}

- (CGRect) getFrameForExpandedFrameViewA {
    CGRect frame = self.frame;
    CGFloat maximunWidth = 540;
    if (UIInterfaceOrientationIsLandscape([UIApplication sharedApplication].statusBarOrientation)) {
        frame.size.height = MIN(self.fullScreenRect.size.height, MIN(maximunWidth, self.helpGestures.count*60)+60.0);
    }
    else {
        frame.size.width = MIN(self.fullScreenRect.size.width, MIN(maximunWidth, self.helpGestures.count*60)+60.0);
    }
    
    if ([UIApplication sharedApplication].statusBarOrientation == UIInterfaceOrientationLandscapeLeft) {
        frame.origin.y -= (frame.size.height - 60.0);
    }
    else if ([UIApplication sharedApplication].statusBarOrientation == UIInterfaceOrientationPortraitUpsideDown) {
        frame.origin.x -= (frame.size.width - 60.0);
    }
    
    frame.origin.x = MAX(0.0, frame.origin.x);
    frame.origin.y = MAX(0.0, frame.origin.y);
    
    frame.origin.x -= MAX(0.0, ((frame.origin.x + frame.size.width) - (self.fullScreenRect.origin.x + self.fullScreenRect.size.width)));
    frame.origin.y -= MAX(0.0, ((frame.origin.y + frame.size.height) - (self.fullScreenRect.origin.y + self.fullScreenRect.size.height)));
    return frame;
}

- (CGRect) getFRameForUnexpandedFrame {
    CGRect frame = self.frame;
    
    if ([UIApplication sharedApplication].statusBarOrientation == UIInterfaceOrientationLandscapeLeft) {
        frame.origin.y += (frame.size.height - 60.0);
    }
    
    if ([UIApplication sharedApplication].statusBarOrientation == UIInterfaceOrientationPortraitUpsideDown) {
        frame.origin.x += (frame.size.width - 60.0);
    }
    
    frame.size.width = 60.0;
    frame.size.height = 60.0;
    
    return frame;
}

- (void) startCloseHelpVisorTimer {
    [self stopCloseHelpVisorTimer];
    self.closeHelpVisorTimer = [NSTimer scheduledTimerWithTimeInterval:3.0
                                                                target:self
                                                              selector:@selector(hideHelpView)
                                                              userInfo:nil
                                                               repeats:NO];
}

- (void) stopCloseHelpVisorTimer {
    [self.closeHelpVisorTimer invalidate];
    self.closeHelpVisorTimer = nil;
}

- (void) showHelpView {
    
    if (showingHelp)
        return;
    showingHelp = YES;
    
    
    [super setAlpha:1.0];
    self.prevCGRect = self.frame;
    //self.panGesture.enabled = NO;
    self.tapGesture.enabled = NO;
    [self cancelIdleTimer];
    [self startCloseHelpVisorTimer];
    
    self.gkLogoImageView.alpha = 1.0;
    self.helpCollectionView.alpha = 1.0;
    self.helpCollectionView.hidden = NO;
    
    self.visibleHelpGestures = [NSMutableArray array];
    [self.visibleHelpGestures addObjectsFromArray:self.helpGestures];
    [self.helpCollectionView reloadData];
    
    helpView.alpha = 1.0;
    canvasForDrawing.alpha = 0.0;
    
    CGFloat animationSpeed = 0.30;
    [UIView animateWithDuration:animationSpeed
                     animations:^{
                         //self.frame = self.fullScreenRect;
                         self.frame = [self getFrameForExpandedFrameViewA];
                     }
                     completion:^(BOOL finished) {
                         
                         [UIView animateWithDuration:animationSpeed
                                          animations:^{
                                              //self.frame = self.fullScreenRect;
                                              self.frame = [self getFrameForExpandedFrameViewB];
                                          }
                                          completion:^(BOOL finished) {
                                              self.hideHelpGesture.enabled = YES;
                                              //[self showHelpGestures];
                                          }];
                     }];
}

- (void) showHelpGestures {
    [self.collectionAnimationTimer invalidate];
    self.visibleHelpGestures = [NSMutableArray array];
    self.indexForAnimation = 0;
    if (self.helpGestures.count > 1) {
        [self.visibleHelpGestures addObject:self.helpGestures[self.indexForAnimation++]];
        [helpCollectionView reloadData];
        self.collectionAnimationTimer = [NSTimer scheduledTimerWithTimeInterval:0.2 target:self selector:@selector(addHelpGestureAnimatedToCollection) userInfo:nil repeats:YES];
        [self performSelector:@selector(addHelpGestureAnimatedToCollection) withObject:nil afterDelay:0.01];
    }
}

- (void)addHelpGestureAnimatedToCollection {
    [self.visibleHelpGestures addObject:self.helpGestures[self.indexForAnimation++]];
    [self.helpCollectionView insertItemsAtIndexPaths:@[[NSIndexPath indexPathForItem:self.visibleHelpGestures.count-1 inSection:0]]];
    if (self.helpGestures.count == self.visibleHelpGestures.count) {
        [self.collectionAnimationTimer invalidate];
    }
}

- (void) hideHelpView {
    [self hideHelpViewAnimated:YES];
}

- (void) hideHelpViewAnimated:(BOOL) animated {
    [self.collectionAnimationTimer invalidate];
    
    self.hideHelpGesture.enabled = NO;
    self.helpCollectionView.hidden = YES;
    self.helpCollectionView.alpha = 0.0;
    
    [self stopCloseHelpVisorTimer];
    
    void (^animationBlock)(void) = ^{
        self.frame = [self getFRameForUnexpandedFrame];//self.prevCGRect;
        canvasForDrawing.alpha = 0.0;
        gkLogoImageView.alpha = 1.0;
    };
    
    void (^afterAnimationBlock)(BOOL finished) = ^(BOOL finished){
        [self idleTimerTimeOut];
        self.panGesture.enabled = YES;
        self.tapGesture.enabled = YES;
        showingHelp = NO;
        [helpCollectionView reloadData];
        [self ensureWindowIsOnScreenAnimated:YES];
    };
    
    if (animated) {
    [UIView animateWithDuration:0.33
                     animations:animationBlock
                     completion:afterAnimationBlock];
    }
    else {
        animationBlock();
        afterAnimationBlock(YES);
    }
}

- (IBAction)onCloseHelpButtonTUI:(id)sender {
    [self hideHelpView];
}

#pragma mark - Touches event
- (void) touchEvent:(NSInteger) pointID beganFromPoint:(CGPoint) point {
    numberOfRunningTouches++;
    [self cancelIdleTimer];
    
    if (showingHelp)
        [self hideHelpViewAnimated:NO];
    
    [super setAlpha:1.0];
    canvasForDrawing.alpha = 1.0;
    gkLogoImageView.alpha = 0.0;
    helpView.alpha = 0.0;
    //Aca empieza el touch
    [canvasForDrawing touchEvent:pointID beganFromPoint:point];
}

- (void) touchEvent:(NSInteger) pointID movedToPoint:(CGPoint) point {
    //Aca se mueve
    [canvasForDrawing touchEvent:pointID movedToPoint:point];
}

- (void) touchEvent:(NSInteger) pointID endedAtPoint:(CGPoint) point {
    numberOfRunningTouches--;
    numberOfRunningTouches = MAX(numberOfRunningTouches, 0);
    
    //Saco el último dedo cierro el view con un timer
    if (numberOfRunningTouches <= 0) {
        [self resetIdleTimer];
    }
    
    //Acá termina
    [canvasForDrawing touchEvent: pointID endedAtPoint:point];
}

- (BOOL)gestureRecognizer:(UIGestureRecognizer *)gestureRecognizer shouldReceiveTouch:(UITouch *)touch {
    if (gestureRecognizer == self.hideHelpGesture) {
        if (showingHelp) {
            NSArray* visibleItems = [helpCollectionView visibleCells];
            for (UIView* item in visibleItems) {
                if (CGRectContainsPoint(item.frame, [touch locationInView:item.superview])) {
                    return NO;
                }
            }
        }
    }
    return YES;
}

- (void) setGesturesArrayForHelp:(NSArray*) array {
    NSMutableArray * mutArray =[NSMutableArray array];
    [mutArray addObjectsFromArray:array];
    
//    [mutArray addObjectsFromArray:array];
//    [mutArray addObjectsFromArray:array];
//    [mutArray addObjectsFromArray:array];
//    [mutArray addObjectsFromArray:array];
//    [mutArray addObjectsFromArray:array];
//    [mutArray addObjectsFromArray:array];
//    [mutArray addObjectsFromArray:array];
    self.helpGestures = [NSArray arrayWithArray:mutArray];
}

#pragma mark - help view
- (NSInteger)collectionView:(UICollectionView *)collectionView numberOfItemsInSection:(NSInteger)section {
    NSInteger count = (!showingHelp)? 0 : self.visibleHelpGestures.count;
    return count;
}

// The cell that is returned must be retrieved from a call to -dequeueReusableCellWithReuseIdentifier:forIndexPath:
- (UICollectionViewCell *)collectionView:(UICollectionView *)collectionView cellForItemAtIndexPath:(NSIndexPath *)indexPath {
    GK_HelpCell* cell = [collectionView dequeueReusableCellWithReuseIdentifier:@"GK_HelpCell" forIndexPath:indexPath];
    [cell setData:[self.visibleHelpGestures objectAtIndex:indexPath.row]];
    return cell;
}

- (void)collectionView:(UICollectionView *)collectionView didSelectItemAtIndexPath:(NSIndexPath *)indexPath {
    [self stopCloseHelpVisorTimer];
    GK_HelpCell* cell = (GK_HelpCell*)[collectionView cellForItemAtIndexPath:indexPath];
    [cell toggleGestureDescription];
}

-(void)scrollViewDidScroll:(UIScrollView *)scrollView {
    [self stopCloseHelpVisorTimer];
}

#pragma mark - setPos
-(void)setPos:(CGPoint)aPos {
    pos = aPos;
    self.frame = CGRectMake(aPos.x, aPos.y, self.frame.size.width, self.frame.size.height);
    [self ensureWindowIsOnScreen];
}

